# MAGIC %md
# MAGIC ## What is Structured Streaming?
# MAGIC 
# MAGIC **Structured Streaming provides fast, scalable, fault-tolerant, end-to-end exactly-once stream processing without the user having to reason about streaming.**
# MAGIC 
# MAGIC * Structured Streaming is a scalable and fault-tolerant stream processing engine built on the Spark SQL engine. 
# MAGIC 
# MAGIC * You can express your streaming computation the same way you would express a batch computation on static data. 
# MAGIC 
# MAGIC * The Spark SQL engine will take care of running it incrementally and continuously and updating the final result as streaming data continues to arrive. 
# MAGIC 
# MAGIC * You can use the Dataset/DataFrame API in Scala, Java, Python or R to express streaming aggregations, event-time windows, stream-to-batch joins, etc. 
# MAGIC 
# MAGIC * Azure Databricks ensures end-to-end exactly-once fault-tolerance guarantees through checkpointing and Write Ahead Logs.

# COMMAND ----------

# MAGIC %md
# MAGIC ## Structured Streaming Performance
# MAGIC 
# MAGIC * Throughtput of millions records/second per node
# MAGIC 
# MAGIC * Scalable to 100s of nodes
# MAGIC 
# MAGIC * End-to-end latencies as low as 100ms with exactly-once fault tolerance
# MAGIC 
# MAGIC * Latencies as low as 1ms with at-least-once guarantees

# COMMAND ----------

