# MAGIC %md
# MAGIC 
# MAGIC ## Structured streaming setup
# MAGIC 
# MAGIC A few parameters must be provided in order to connect. Each one **must** be prefixed with `eventhubs.`!
# MAGIC 
# MAGIC | Parameter | Meaning |
# MAGIC | --------- | ------- |
# MAGIC | `policyname` | EventHub connection policy name. Can be created on a namespace or individual EventHub level. It needs to have `Listen` permissions. |
# MAGIC | `policykey` | Key associated with the above policy. |
# MAGIC | `namespace` | EventHub namespace to connect to. |
# MAGIC | `name` | EventHub name within the namespace. |
# MAGIC | `partition.count` | Number of partitions available in the EventHub. |
# MAGIC | `consumergroup` | Consumer group to use when connecting. **Note:** Only one connection can be active per consumer group at a time. |
# MAGIC | `progressTrackingDir` | Directory to use to store progress files in. This is so your progress in the event stream won't be lost in case of job restarts. |
# MAGIC | `maxRate` | Maximum number of events to consume **per partition** per batch. |
# MAGIC | `sql.containsProperties` | Set to `true` if you want to extract custom properties from the Event properties |
# MAGIC | `sql.userDefinedKeys` | Comma-separated names of properties to extract from Event properties. |

# COMMAND ----------

eventHubNamespace = "gbb-workshop"
progressDir = "/tmp/gbb-workshop/eventhub-orders-progress"
policyName = "consumer"
policyKey = "consumer_key_goes_here"
eventHubName = "orders"
consumerGroup = "$Default"

# COMMAND ----------

inputStream = (spark.readStream
.format("eventhubs")
.option("eventhubs.policyname", policyName)
.option("eventhubs.policykey", policyKey)
.option("eventhubs.namespace", eventHubNamespace)
.option("eventhubs.name", eventHubName)
.option("eventhubs.partition.count", "2")
.option("eventhubs.maxRate", "100")
.option("eventhubs.consumergroup", consumerGroup)
.option("eventhubs.progressTrackingDir", progressDir)
.load())

# COMMAND ----------

df = inputStream.select((inputStream.body.cast("string")))

# COMMAND ----------

# MAGIC %md
# MAGIC ## What can we do with this Streaming DataFrame?
# MAGIC 
# MAGIC If you run the following cell, you'll get a continuously updating display of the number of records read from the stream so far. Note that we're just calling `display()` on our DataFrame, _exactly_ as if it were a DataFrame reading from a static data source.
# MAGIC 
# MAGIC To stop the continuous update, just cancel the query.

# COMMAND ----------

display(df)

# COMMAND ----------

# MAGIC %md
# MAGIC ## Let's convert the JSON string into columns of a Spark DataFrame?

# COMMAND ----------

from pyspark.sql.types import *
schema = StructType([ \
  StructField("orderUUID", StringType(), True), \
  StructField("productId", IntegerType(), True), \
  StructField("userId", IntegerType(), True), \
  StructField("quantity", IntegerType(), True), \
  StructField("discount", DoubleType(), True), \
  StructField("orderTimestamp", TimestampType(), True)])

# COMMAND ----------

from  pyspark.sql.functions import *
sDf = inputStream.select(from_json(inputStream.body.cast("string"), schema).alias('fields'), "enqueuedTime").select("fields.*", col("enqueuedTime").cast("timestamp"))

# COMMAND ----------

# MAGIC %md-sandbox
# MAGIC <h3 style="color:green">Databricks Tip</h3>
# MAGIC 
# MAGIC * Streaming tables & visualizations

# COMMAND ----------

display(sDf)

# COMMAND ----------

# MAGIC %md-sandbox
# MAGIC <h2 style="color:red">Do Part 1 of Streaming Lab</h2>

# COMMAND ----------

# MAGIC %md ##![Spark Logo Tiny](https://kpistoropen.blob.core.windows.net/collateral/roadshow/logo_spark_tiny.png) *Part-2:* Transform Streaming DataFrame 

# COMMAND ----------

# MAGIC %md ### It's just a DataFrame
# MAGIC 
# MAGIC We can use normal DataFrame transformations on our streaming DataFrame. For example, let's group the number of orders by productId
# MAGIC 
# MAGIC <img src="https://spark.apache.org/docs/latest/img/structured-streaming-example-model.png"/>

# COMMAND ----------

sDfTopProducts = sDf.groupBy("productId").agg(sum("quantity").alias("total_units_by_product")).orderBy(desc("total_units_by_product"))

# COMMAND ----------

# MAGIC %md-sandbox
# MAGIC <h3 style="color:green">Databricks Tip</h3>
# MAGIC 
# MAGIC * Statefull aggregations the same as batch!
# MAGIC * Streaming Dashboards

# COMMAND ----------

display(sDfTopProducts)

# COMMAND ----------

# MAGIC %md ### More Comfortable in SQL?

# COMMAND ----------

sDf.createOrReplaceTempView("streaming_table")

# COMMAND ----------

# MAGIC %sql select * from streaming_table

# COMMAND ----------

# MAGIC %sql 
# MAGIC SELECT 
# MAGIC   sum(quantity) AS total_units_by_product,
# MAGIC   productId 
# MAGIC   FROM streaming_table 
# MAGIC   GROUP BY productId
# MAGIC   ORDER BY total_units_by_product DESC

# COMMAND ----------

# MAGIC %md-sandbox
# MAGIC <h2 style="color:red">Do Part 2 of Streaming Lab</h2>

# COMMAND ----------

# MAGIC %md ##![Spark Logo Tiny](https://kpistoropen.blob.core.windows.net/collateral/roadshow/logo_spark_tiny.png) *Part-3:* Streaming Joins

# COMMAND ----------

# MAGIC %md ### Streaming Joins
# MAGIC 
# MAGIC Grouping by unkown product IDs is not that that exciting. Let's join the stream with the product lookup data set

# COMMAND ----------

productLookUp = spark.read.parquet("/mnt/training-sources/initech/productsFull/")

# COMMAND ----------

joinedDf = sDf.join(productLookUp, "ProductID")

# COMMAND ----------

display(joinedDf)

# COMMAND ----------

# MAGIC %md-sandbox
# MAGIC <h2 style="color:red">Do Part 3 of Streaming Lab</h2>

# COMMAND ----------

# MAGIC %md ##![Spark Logo Tiny](https://kpistoropen.blob.core.windows.net/collateral/roadshow/logo_spark_tiny.png) *Part-4:* Calculate a Streaming Dashboard - Revenue by Product Name 

# COMMAND ----------

# MAGIC %md ### Calculate the Total Revenue by Product Name
# MAGIC 
# MAGIC * Now that we have the product `Name` let's use that instead of the `productId` to `groupBy`
# MAGIC * Also let's calculate the total revenue instead of just units sold
# MAGIC   * Use the `quanity` column and the `StandardCost` column 

# COMMAND ----------

joinedTopProducts = joinedDf.groupBy("Name").agg(sum(col("quantity")*col("StandardCost")).alias("total_revenue_by_product")).orderBy(desc("total_revenue_by_product"))

# COMMAND ----------

display(joinedTopProducts)

# COMMAND ----------

# MAGIC %md-sandbox
# MAGIC <h2 style="color:red">Do Part 4 of Streaming Lab</h2>

# COMMAND ----------

# MAGIC %md ##![Spark Logo Tiny](https://kpistoropen.blob.core.windows.net/collateral/roadshow/logo_spark_tiny.png) *Part-5:* Stream Data to Azure Storage / Azure Data Lake
# MAGIC * Optimial Parquet: make the data available for everyone

# COMMAND ----------

joinedDf \
    .repartition(1) \
    .writeStream \
    .format("parquet") \
    .option("checkpointLocation", "dbfs:/tmp/streaming/training-msft/initech/order/checkpoint/") \
    .option("path", "dbfs:/tmp/streaming/training-msft/initech/order/data/") \
    .trigger(processingTime='15 seconds') \
    .start()

